        $buffer .= $indent . '							<textarea name="description" class="input-block-level tinymce" id="description" rows="8">&lt;p&gt;Makkelijk, snel, veilig én gezellig. Dat is waar de Babboe Bakfiets voor staat. De wereld aan je voeten met de kinderen voor je neus. Onderweg naar school, vriendjes, supermarkt, speeltuin, park of ander uitje. De bakfietsen van &lt;a href=&quot;http://www.babboe.nl &quot; target=&quot;_blank&quot;&gt;Babboe&lt;/a&gt; zijn het ideale vervoermiddel voor je kinderen met extra ruimte voor boodschappen, buggy of andere zaken. Bekijk ook de &lt;a href=&quot;https://www.facebook.com/Babboe&quot; target=&quot;_blank&quot;&gt;Babboe facebook pagina&lt;/a&gt;!&lt;/p&gt;&lt;h2&gt;De Bakfiets: een feestje op wielen&lt;/h2&gt;&lt;p&gt;Een bakfiets vol kinderenergie is een dagelijkse belevenis. Omdat je kinderen voor je zitten, heb je ze constant in het oog. Zo kun je gezellig met elkaar babbelen en is het ook nog eens veilig. Je passagiertjes zitten in een stevige houten bak, vastgeklikt met een driepuntsgordel. Met de Babboe Bakfiets maak je van ieder tochtje een feestje!&lt;/p&gt;&lt;h2&gt;Betaalbare kwaliteit&lt;/h2&gt;&lt;p&gt;Babboe Bakfiets is een initiatief van ouders voor ouders. &lt;a href=&quot;http://www.babboe.nl &quot; target=&quot;_blank&quot;&gt;Babboe&lt;/a&gt; wilt de bakfiets bereikbaar maken voor ieder gezin. Vanuit die gedachte ontwikkelt Babboe sinds 2007 kwalitatief goede bakfietsen voor een betaalbare prijs. De bakfietsen worden ook steeds beter dankzij de ervaringen en tips die ouders met hun delen. Zo is Babboe Bakfiets uitgegroeid tot de grootste in Nederland.&lt;/p&gt;&lt;h2&gt;De bakfiets: Babboe City&lt;/h2&gt;&lt;p&gt;De Babboe City is een stevige 2-wiel bakfiets met een robuust modern design, met een speciaal ontworpen bak met zachte ronde hoeken. De ontwikkeling stond volledig in het teken van veiligheid, stevigheid en design. Ideaal voor twee kindjes en boodschappen. Kortom, een bakfiets waarmee je gezien mag worden! &lt;a href=&quot;https://www.babboe.nl/productinformatie/bakfiets/babboe-city.html &quot; target=&quot;_blank&quot;&gt;Klik hier&lt;/a&gt; voor meer informatie.&lt;/p&gt;&lt;h2&gt;De bakfiets: Babboe Curve&lt;/h2&gt;&lt;p&gt;De Babboe Curve bakfiets is een eigentijdse 3-wiel bakfiets met hoge kwaliteitseisen voor een betaalbare prijs. De Babboe Curve bakfiets is mooi, kwalitatief en slim uitgevoerd. De bak heeft ronde hoeken, dus geen scherpe hoeken waar je kindjes zich aan kunnen bezeren, en de bak is daardoor echt van deze tijd, anders dan alle andere bakken. En heel praktisch, want er passen vier kindjes in, of lekker veel boodschappen. Een bakfiets waarmee je gezien mag worden! &lt;a href=&quot;https://www.babboe.nl/productinformatie/bakfiets/babboe-curve.html &quot; target=&quot;_blank&quot;&gt;Klik hier&lt;/a&gt; voor meer informatie.&lt;/p&gt;&lt;h2&gt;Testmoeders&lt;/h2&gt;&lt;p&gt;Onze testmoeders hebben de bakfietsen getest en zijn enthousiast! Klik op een moeder en bekijk de review.&amp;nbsp;&lt;/p&gt;</textarea>';
